[force_move]
enable_force_move: True

#################################################
# MCUs
#################################################
[mcu]
serial:         /dev/serial/by-id/usb-Klipper_stm32f446xx_32004D001550335331383520-if00
restart_method: command

[mcu supernova]
serial:         /dev/serial/by-id/usb-Klipper_stm32f103xe_517A150000C0542810876107-if00
restart_method: command

#################################################
# Temperature Sensors
#################################################
[temperature_sensor octopro]
sensor_type:    temperature_mcu
min_temp:       0
max_temp:       100

[temperature_sensor rpi]
sensor_type:    temperature_host
min_temp:       0
max_temp:       100

[temperature_sensor supernova]
sensor_type:    temperature_mcu
sensor_mcu:     supernova
min_temp:       0
max_temp:       100

#################################################
# Printer
#################################################
[printer]
kinematics:             corexy
max_velocity:           1000
max_accel:              9800
max_z_velocity:         15
max_z_accel:            350
square_corner_velocity: 10.0

[gcode_arcs]
resolution: 0.2

[exclude_object]
[motion_minder]
[skew_correction]

[axis_twist_compensation]
calibrate_start_x: 10
calibrate_end_x: 270
calibrate_x: 140
calibrate_start_y: 54
calibrate_end_y: 290
calibrate_y: 160

#################################################
# Board Pin Aliases
#################################################
[board_pins]
aliases:
    # EXP1 header
    EXP1_1=PE8, EXP1_2=PE7,
    EXP1_3=PE9, EXP1_4=PE10,
    EXP1_5=PE12, EXP1_6=PE13,
    EXP1_7=PE14, EXP1_8=PE15,
    EXP1_9=<GND>, EXP1_10=<5V>,

    # EXP2 header
    EXP2_1=PA6, EXP2_2=PA5,
    EXP2_3=PB1, EXP2_4=PA4,
    EXP2_5=PB2, EXP2_6=PA7,
    EXP2_7=PC15, EXP2_8=<RST>,
    EXP2_9=<GND>, EXP2_10=<5V>

[resonance_tester]
accel_chip: beacon
probe_points: 150,150,20

[temperature_sensor chamber_temp_rear]
sensor_type: PT1000
sensor_pin: PF4
min_temp: -50
max_temp: 500

[temperature_sensor chamber_temp_front]
sensor_type: ATC Semitec 104NT-4-R025H42G
sensor_pin: PF5
min_temp: -50
max_temp: 300

[temperature_sensor chamber_temp]
sensor_type: temperature_combined
sensor_list: temperature_sensor chamber_temp_rear, temperature_sensor chamber_temp_front
combination_method: mean
maximum_deviation: 999.9

#################################################
# Bed
####################################################
[heater_bed]
heater_pin:     PB11
sensor_type:    Generic 3950
sensor_pin:     PF3
max_power:      0.6
min_temp:       0
max_temp:       120
#control: pid

#################################################
# Quad Gantry Level
#################################################
[quad_gantry_level]
gantry_corners:
    -60,-10
    360,370
points:
    50,70
    50,250
    230, 250
    230, 70
speed: 500
horizontal_move_z: 10
retries: 5
retry_tolerance: 0.0075
max_adjust: 10

#################################################
# Steppers
#################################################
[stepper_x]
step_pin: supernova:PB14
dir_pin: !supernova:PB13
enable_pin: !supernova:PB15
rotation_distance: 40
microsteps: 64
full_steps_per_rotation: 200
endstop_pin:                tmc5160_stepper_x:virtual_endstop
position_min:               0
position_endstop:           0
position_max:               280
homing_speed:               150
homing_retract_dist:        0
homing_positive_dir:        false

[stepper_y]
step_pin: supernova:PA9
dir_pin: !supernova:PA8
enable_pin: !supernova:PA10
rotation_distance: 40
microsteps: 64
full_steps_per_rotation: 200
endstop_pin:                tmc5160_stepper_y:virtual_endstop
position_min:               20
position_endstop:           305
position_max:               305
homing_speed:               150
homing_retract_dist:        0
homing_positive_dir:        true

[stepper_y1]
step_pin:                   supernova:PB5
dir_pin:                    !supernova:PB4
enable_pin:                 !supernova:PB6
rotation_distance:          40
microsteps:                 64 # Previously 32
full_steps_per_rotation:    200


[stepper_x1]
step_pin:                   supernova:PB8
dir_pin:                    !supernova:PB7
enable_pin:                 !supernova:PB9
rotation_distance:          40
microsteps:                 64 # Previously 32
full_steps_per_rotation:    200

[stepper_z]
step_pin:           PF9
dir_pin:            PF10
enable_pin:         !PG2
rotation_distance:  40
gear_ratio:         80:16
microsteps:         32
endstop_pin: probe:z_virtual_endstop
position_max: 190
position_min: -5
homing_speed: 8
second_homing_speed: 3
homing_retract_dist: 0

[stepper_z1]
