dir_pin:            !PE3
enable_pin:         !PD4
rotation_distance:  40
gear_ratio:         80:16
microsteps:         32

[stepper_z2]
step_pin:           PC13
dir_pin:            PF0
enable_pin:         !PF1
rotation_distance:  40
gear_ratio:         80:16
microsteps:         32

[stepper_z3]
step_pin: PG4
dir_pin: !PC1
enable_pin: !PA0
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32

[extruder]
